Rangwali Holi 
@theterracoindia 

India is a country of diverse cultures and traditions.
Beauty of Holi tradition sieved in emotions of oneness was first demonstrated by Lord Krishna by putting colors on Radha’s face to signify equality,eternal love and oneness of soul.
We, The Terra Co., bring you colours of oneness as handcrafted to celebrate Holi in an environment friendly way.
And our story begins ..
{Gulab Ke Phool}
Searching for the flowers ,the ingredients from nature to spread the colour of emotions, and happiness.
And Santosh didi and Laxmi didi who handcrafted the colours say, “ Didi, inse hum rang banaenge? Yeh to both achha hai!”

{Rang ka Chullah}
Steaming the petals to extract colours of India, a colour that signifies bliss, a colour that sings the poetry of oneness, a colour that is a gift of nature.

{Rangon ki boondein}
Extracting the colours from petals from beauties of nature collected from surroundings filling up our lota of tradition.
And Rama Didi said, “ Didi isme se toh both achi Khushboo aa rahi hai.” 

{Anekta mei ekta}
Creating a mixture of oneness and celebration by rubbing the colour and essential oils to create a colour that speaks language of its own beauty and emotions of women of India – creating colour of oneness.

{Maa ka aanchal}
Creating a sieve out of Mom’s dupatta that signifies unconditional love, an emotional journey . As our mother saves us from all the negativity of the world , we want to celebrate the victory of good over evil.

{Rangon ki bhasha}
The colours speak the story – The Story of India

And Rupali says, “ Main iss desh ki beti hu aur iss desh ne mujhe boht kuch dia hai – iss desh ki mitti, kheton ke rang, Charkha, anekta mei ekta, haldi ki khushboo, shiksha , aage badhne ka saahas, rangon se bhara mera Bharat.

